using System;
using System.Data;
using System.Data.SqlClient;

namespace CMS2.ClientDbSetup
{
    internal class Program
    {
        private static void Main(string[] args)
        {
            string serverName = "";
            string dbUserName = "";
            string dbPassword = "";
            string connString = "";
            DbSchema dbSchema = new DbSchema();
            
            Console.WriteLine("Local CMS2 DB Setup");
            Console.Write("Enter Server Name/IP: ");
            serverName = Console.ReadLine();
            Console.Write("Enter DB Username: ");
            dbUserName = Console.ReadLine();
            Console.Write("Enter DB Password: ");
            dbPassword = Console.ReadLine();
            connString = string.Format("Data Source = {0}; Initial Catalog =master; User ID = {1}; Password = {2}; Connect Timeout = 0;", serverName, dbUserName, dbPassword);

            SqlConnection localConn = new SqlConnection(connString);
            SqlCommand cmd = new SqlCommand();
            cmd.Connection = localConn;

            try
            {
                if (localConn.State == ConnectionState.Closed)
                    localConn.Open();
            }
            catch (Exception)
            {
                Console.WriteLine("Cannot connect to database.");
                Console.ReadLine();
                Environment.Exit(0);
            }

            string scriptDropCreate = "";
            try
            {
                scriptDropCreate = dbSchema.DropCreate;
                if (string.IsNullOrEmpty(scriptDropCreate))
                {
                    Console.WriteLine("DropCreate script is empty.");
                    Console.ReadLine();
                    Environment.Exit(0);
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine("Error reading CMS2 DB schema.");
                Console.ReadLine();
                Environment.Exit(0);
            }

            string scriptCms2Db = "";
            try
            {
                scriptCms2Db = dbSchema.Cms2Schema;
                if (string.IsNullOrEmpty(scriptCms2Db))
                {
                    Console.WriteLine("CMS2 DB schema is empty.");
                    Console.ReadLine();
                    Environment.Exit(0);
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine("Error reading CMS2 DB schema.");
                Console.ReadLine();
                Environment.Exit(0);
            }

            string initCms2Records = "";
            try
            {
                initCms2Records = dbSchema.Cms2InitialData;
                if (string.IsNullOrEmpty(initCms2Records))
                {
                    Console.WriteLine("CMS2 initial data is empty.");
                    Console.ReadLine();
                    Environment.Exit(0);
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine("Error reading CMS2 initial data.");
                Console.ReadLine();
                Environment.Exit(0);
            }

            string scriptTacking2Db = "";
            try
            {
                scriptTacking2Db = dbSchema.Tracking2Schema;
                if (string.IsNullOrEmpty(scriptTacking2Db))
                {
                    Console.WriteLine("Tracking2 schema is empty.");
                    Console.ReadLine();
                    Environment.Exit(0);
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine("Error reading Tracking2 schema.");
                Console.ReadLine();
                Environment.Exit(0);
            }

            string proceed = "";
            Console.Write("Proceed(Y/N): ");
            proceed = Console.ReadLine();

            if (proceed.Equals("Y"))
            {
                try
                {
                    Console.WriteLine("Creating CMS2 and Tracking2 databases, please wait ....");
                    cmd.CommandText = scriptDropCreate;
                    cmd.ExecuteNonQuery();
                    Console.WriteLine("Done creating databases.");

                    Console.WriteLine("Creating CMS2 tables, please wait ....");
                    cmd.CommandText = scriptCms2Db;
                    cmd.ExecuteNonQuery();
                    Console.WriteLine("Done creating CMS2 tables.");

                    Console.WriteLine("Creating Tacking2 tables, please wait ....");
                    cmd.CommandText = scriptTacking2Db;
                    cmd.ExecuteNonQuery();
                    Console.WriteLine("Done creating Tacking2 tables.");

                    Console.WriteLine("Creating CMS2 initial data, please wait ....");
                    cmd.CommandText = initCms2Records;
                    cmd.ExecuteNonQuery();
                    Console.WriteLine("Done creating CMS2 initial data .");

                    Console.ReadLine();
                    Environment.Exit(0);
                }
                catch (Exception ex)
                {
                    Console.WriteLine("Error found while during the process.");
                    Console.ReadLine();
                    Environment.Exit(0);
                }
            }
            else
            {
                Console.WriteLine("Wrong response or you opted not to execute.");
                Console.ReadLine();
                Environment.Exit(0);
            }
        }
    }

